import React from 'react'

function App() {
  const Header =(props)=>{
    return(
      <header>
        <h1>
          <a href='/'>{props.title}</a>
        </h1>
      </header>
    )
  }
  const Nav =()=> {
    return(
      <nav>
      <ol>
        <li><a href='/reade/1'>html</a></li>
        <li><a href='/reade/2'>css</a></li>
        <li><a href='/reade/3'>js</a></li>
      </ol>
    </nav>
    )
  }
  const Article =(props)=> {
    const topics = [
      {id:1, title:"html", body:"html is ..."},
      {id:2, title:"css", body:"css is ..."},
      {id:3, title:"javascript", body:"javascript is ..."},
    ]
    return(
      <article>
        <h2>{props.title}</h2>
        {props.body}
      </article>
    )
  }
  return (
    <div>
      <Header title="WEB"></Header>
      <Nav topics></Nav>
      <Article title="Welcome" body="Hello, WEB"></Article>
    </div>
  )
}

export default App
